import React, { useState } from 'react';
import { downloadFile } from '../services/api';
import './OCRResults.css';

const OCRResults = ({ results, onClear, processing }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [sortBy, setSortBy] = useState('filename');
  const [filterBy, setFilterBy] = useState('all');

  // Filtreleme ve sƒ±ralama
  const filteredResults = results
    .filter(result => {
      if (filterBy === 'success') return !result.error;
      if (filterBy === 'error') return result.error;
      return true;
    })
    .filter(result => 
      result.filename.toLowerCase().includes(searchTerm.toLowerCase()) ||
      (result.text && result.text.toLowerCase().includes(searchTerm.toLowerCase()))
    )
    .sort((a, b) => {
      switch (sortBy) {
        case 'filename':
          return a.filename.localeCompare(b.filename);
        case 'confidence':
          return (b.confidence || 0) - (a.confidence || 0);
        case 'wordCount':
          return (b.wordCount || 0) - (a.wordCount || 0);
        default:
          return 0;
      }
    });

  const successCount = results.filter(r => !r.error).length;
  const errorCount = results.filter(r => r.error).length;

  const handleDownloadText = (result) => {
    if (result.text) {
      downloadFile(result.text, `${result.filename}_extracted.txt`, 'text/plain');
    }
  };

  const handleDownloadAll = () => {
    const successResults = results.filter(r => !r.error && r.text);
    if (successResults.length === 0) return;

    const combinedText = successResults.map(result => 
      `=== ${result.filename} ===\n${result.text}\n\n`
    ).join('');

    downloadFile(combinedText, 'all_extracted_texts.txt', 'text/plain');
  };

  const copyToClipboard = async (text) => {
    try {
      await navigator.clipboard.writeText(text);
      // Toast notification burada eklenebilir
    } catch (err) {
      console.error('Panoya kopyalanamadƒ±:', err);
    }
  };

  const getConfidenceColor = (confidence) => {
    if (confidence >= 90) return '#28a745';
    if (confidence >= 70) return '#ffc107';
    return '#dc3545';
  };

  const getFileTypeIcon = (filename) => {
    const ext = filename.split('.').pop().toLowerCase();
    switch (ext) {
      case 'pdf': return 'üìÑ';
      case 'jpg':
      case 'jpeg': return 'üì∏';
      case 'png': return 'üñºÔ∏è';
      case 'gif': return 'üéûÔ∏è';
      default: return 'üìÅ';
    }
  };

  return (
    <div className="ocr-results card">
      <div className="results-header">
        <div className="header-left">
          <h3>üìä OCR Sonu√ßlarƒ±</h3>
          <div className="results-summary">
            <span className="summary-item success">
              ‚úÖ {successCount} ba≈üarƒ±lƒ±
            </span>
            {errorCount > 0 && (
              <span className="summary-item error">
                ‚ùå {errorCount} hata
              </span>
            )}
          </div>
        </div>

        <div className="header-actions">
          <button
            onClick={handleDownloadAll}
            className="btn btn-success btn-sm"
            disabled={successCount === 0}
            title="T√ºm metinleri indir"
          >
            üì• T√ºm√ºn√º ƒ∞ndir
          </button>
          <button
            onClick={onClear}
            className="btn btn-secondary btn-sm"
            disabled={processing}
            title="Sonu√ßlarƒ± temizle"
          >
            üóëÔ∏è Temizle
          </button>
        </div>
      </div>

      <div className="results-controls">
        <div className="search-box">
          <input
            type="text"
            placeholder="Dosya adƒ± veya metin i√ßeriƒüinde ara..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            className="search-input"
          />
          <span className="search-icon">üîç</span>
        </div>

        <div className="filter-controls">
          <select
            value={sortBy}
            onChange={(e) => setSortBy(e.target.value)}
            className="control-select"
          >
            <option value="filename">üìù Dosya Adƒ±</option>
            <option value="confidence">üéØ G√ºven Skoru</option>
            <option value="wordCount">üìä Kelime Sayƒ±sƒ±</option>
          </select>

          <select
            value={filterBy}
            onChange={(e) => setFilterBy(e.target.value)}
            className="control-select"
          >
            <option value="all">üìã T√ºm√º</option>
            <option value="success">‚úÖ Ba≈üarƒ±lƒ±</option>
            <option value="error">‚ùå Hatalƒ±</option>
          </select>
        </div>
      </div>

      <div className="results-list">
        {filteredResults.length === 0 ? (
          <div className="no-results">
            <div className="no-results-icon">üîç</div>
            <p>Arama kriterlerine uygun sonu√ß bulunamadƒ±</p>
          </div>
        ) : (
          filteredResults.map((result) => (
            <div key={result.id} className={`result-item ${result.error ? 'error' : 'success'}`}>
              <div className="result-header">
                <div className="file-info">
                  <span className="file-icon">{getFileTypeIcon(result.filename)}</span>
                  <span className="filename">{result.filename}</span>
                  {result.type && (
                    <span className="file-type">{result.type.toUpperCase()}</span>
                  )}
                </div>

                <div className="result-stats">
                  {!result.error && (
                    <>
                      <div className="confidence-badge">
                        <span 
                          className="confidence-value"
                          style={{ color: getConfidenceColor(result.confidence) }}
                        >
                          üéØ {result.confidence}%
                        </span>
                      </div>
                      {result.wordCount && (
                        <span className="word-count">üìä {result.wordCount} kelime</span>
                      )}
                      {result.pageCount && (
                        <span className="page-count">üìÑ {result.pageCount} sayfa</span>
                      )}
                    </>
                  )}
                </div>
              </div>

              {result.error ? (
                <div className="error-content">
                  <div className="error-message">
                    ‚ùå {result.error}
                  </div>
                </div>
              ) : (
                <div className="text-content">
                  <div className="text-preview">
                    {result.text ? (
                      <pre className="extracted-text">
                        {result.text.slice(0, 300)}
                        {result.text.length > 300 && '...'}
                      </pre>
                    ) : (
                      <span className="no-text">Metin √ßƒ±karƒ±lamadƒ±</span>
                    )}
                  </div>

                  {result.text && (
                    <div className="text-actions">
                      <button
                        onClick={() => copyToClipboard(result.text)}
                        className="btn btn-secondary btn-sm"
                        title="Panoya kopyala"
                      >
                        üìã Kopyala
                      </button>
                      <button
                        onClick={() => handleDownloadText(result)}
                        className="btn btn-primary btn-sm"
                        title="Metin dosyasƒ± olarak indir"
                      >
                        üíæ ƒ∞ndir
                      </button>
                    </div>
                  )}
                </div>
              )}
            </div>
          ))
        )}
      </div>

      {filteredResults.length > 0 && (
        <div className="results-footer">
          <div className="results-count">
            G√∂sterilen: {filteredResults.length} / {results.length} sonu√ß
          </div>
        </div>
      )}
    </div>
  );
};

export default OCRResults;
